import React from "react";
import SearchBar from "./SearchBar";
import _ from "lodash";
import StockGraph from "./StockGraph";

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      dataStore: [],
    };
  }

  onTermSubmit = (data) => {
    // const stocks = data["Time Series (Daily)"].map((time) => console.log(time));

    var DataStore = {
      date: [],
      open: [],
      high: [],
      low: [],
      close: [],
      volume: [],
    };
    var temp = data["Time Series (Daily)"];
    for (var tempData in temp) {
      // Here You get your Date
      //   console.log("Your Date - " + tempData);
      //   console.log(tSeries[tempData]);
      //   console.log(tSeries[tempData]["1. open"]);
      //   console.log(tSeries[tempData]["2. high"]);
      DataStore.date.push(tempData);
      DataStore.open.push(temp[tempData]["1. open"]);
      DataStore.high.push(temp[tempData]["2. high"]);
      DataStore.low.push(temp[tempData]["3. low"]);
      DataStore.close.push(temp[tempData]["4. close"]);
      DataStore.date.push(temp[tempData]["5. volume"]);

      //   DataStore.push({
      //     Date: tempData,
      //     open: temp[tempData]["1. open"],
      //     high: temp[tempData]["2. high"],
      //     low: temp[tempData]["3. low"],
      //     close: temp[tempData]["4. close"],
      //     volume: temp[tempData]["5. volume"],
      //   });
    }
    this.setState({ dataStore: DataStore });
    console.log(this.state);

    // .catch(error => console.log(error))
  };

  render() {
    return (
      <div className=" ui container">
        <SearchBar onTermSubmit={this.onTermSubmit} />
        <StockGraph data={this.state.dataStore} />
      </div>
    );
  }
}

export default App;
